    clear all;

%%
    Res = Set_Up_Methods_For_Chi23_Paper;
    
%%
    
    Res.CW.In         = Params_LiNbd;
    Res.CW.In.eps     = -2*pi*10E9;
    Res.CW.In.delta_o = 0;
    Res.CW.In.N       = 2^6;
    Res.CW.In.W       = 100000*Res.CW.In.W_Star;
    
%%
    Res.CW.Par.Equation_string  = 'Chi23_CW';
    Res.CW.Met.Equation         = @Chi23_CW;
    Res.CW.Met.InitialGuess     = @Chi_3_Stat_In_Guess_Chi_3_LLE_From_CW;    
    Res.CW.Met.Newton           = @fsolve;%'fsolve'
    Res.CW.Par.Change_Space     = 0;
    
    Res.CW.Par.variable         = 'delta_o';  %%'Pump Power';
    Res.CW.Par.first_step       = 0.07; % step for delta measured in delta/kappa
    Res.CW.Par.step_tol         = 0.03;
    Res.CW.Par.step_inc         = 1;
    Res.CW.Par.step_dec         = 0.7;

    Res.CW.Par.bot_boundary     = -100; % bottom boundary for delta to search
    Res.CW.Par.top_boundary     =  -50; % top boundary for delta to search
    Res.CW.Par.Sol_Re_Sign      = '-';
    Res.CW.Par.Stability        = false;
    Res.CW.Par.Newton_iter      = 30;      
    Res.CW.Par.Newton_tol       = 1E-10;  
    Res.CW.Par.i_max            = 1000;
    
    Res.CW.Par.fsolveoptions     = optimoptions('fsolve','CheckGradients',...
    false,'Display','none','UseParallel',false,'SpecifyObjectiveGradient',false,...
    'Algorithm','trust-region-dogleg','FunValCheck','on',...
    'MaxIterations',1000,'StepTolerance',1E-25,'OptimalityTolerance',1E-25,'FunctionTolerance',10^(-10));

%%
    W_Finish     = 10000;
    delta_Finish = 3;
    NN           = 72;
    delta_vector = linspace(-75.76,-85,NN);
    Power_vector = linspace(7E7,15E7,NN);
    
    parfor i =1:NN
        
       Res_S(i) = Get_The_Branch_for_Power(Res,delta_vector(i),Power_vector(i),100);
       
    end
    
%%
    N_max = 0;
    for i = 1:NN
        N_max = max(N_max,size(Res_S(i).Stat,2));
    end
%%
    ind_mu  = 2;
    Conv_eff= NaN(NN,N_max);
    delta_matrix= NaN(NN,N_max);
    W_matrix= NaN(NN,N_max);
    Psi_1   =NaN(NN,N_max);
    for i =1:NN
        for j = 1:size(Res_S(i).Stat,2)
            delta_matrix (i,j) = Res_S(i).Stat(j).Eq.delta_o;
            W_matrix (i,j) = Res_S(i).Stat(j).In.W/Res_S(i).Stat(j).In.W_Star;
            Conv_eff(i,j) = abs(Res_S(i).Stat(j).Sol.Psi_e(ind_mu)).^2/abs(Res_S(i).Stat(j).Sol.Psi_o(ind_mu)).^2;
            Psi_1(i,j) = abs(Res_S(i).Stat(j).Sol.Psi_o(2)).^2;
        end
    end
%%
figure;
mesh(delta_matrix,W_matrix,Conv_eff);
zlim([1.3,2])
